create TABLE Persons
(
    user_id varchar(20)not null primary key REFERENCES users(user_id),
    salutations varchar(128)not null,
    first_name VARCHAR(128),
    last_name varchar (128)not null,
    street_address1 varchar(128)not null,
    street_address2 varchar(128)not null,
    city varchar (62) not null,
    province char(2),
    postal_code varchar (6) not null,
    primary_phone_number varchar(12),
    secondary_phone_number varchar(12),
    fax_number varchar(12),
    preffered_contact_method char(1)
);

